    const { children, openpopup, setopenpopup } = prop
    const theme = createTheme({
        status: {
            danger: orange[500],
        },
    });

    return (
        <Dialog open={openpopup} maxWidth="lg" theme={theme} >
            <DialogContent>
                {children}
            </DialogContent>

        </Dialog>
    )


}
export default SignInPopUp
